import React, { useState } from "react";
import ImageMapper from 'react-image-mapper';
import {
  Paper,
  Grid,
  LinearProgress,
  Select,
  OutlinedInput,
  MenuItem,
  Box,
  Table,
  TableBody,
  TableRow,
  TableCell,
  Checkbox,
  TablePagination,
  TableHead,
  TableSortLabel,
  Toolbar,
  IconButton, Menu
} from "@material-ui/core";
import { useTheme, makeStyles } from "@material-ui/styles";
import {
  ResponsiveContainer,
  ComposedChart,
  AreaChart,
  Line,
  Area,
  PieChart,
  Pie,
  Cell,
  YAxis,
  XAxis,
  Tooltip
} from "recharts";

import Image from '../../images/adrian-marc-amarc-cyberoom-v3.svg';
// styles
import useStyles from "./styles";

// components
import mock from "./mock";
import Widget from "../../components/Widget";
import { Chip, Typography, Avatar } from "../../components/Wrappers";
import Dot from "../../components/Sidebar/components/Dot";
import BigStat from "./components/BigStat/BigStat";
import {
  Delete as DeleteIcon,
  FilterList as FilterListIcon, MoreVert as MoreIcon,
} from "@material-ui/icons";
import PropTypes from "prop-types";
import { lighten } from "@material-ui/core/styles";
import cn from "classnames";

const MAP = {
  name: "my-map",
  areas: [
    { name: "1", shape: "poly", coords: [25,33,27,300,128,240,128,94], preFillColor: "green", fillColor: "blue"  },
    { name: "2", shape: "poly", coords: [219,118,220,210,283,210,284,119], preFillColor: "pink"  },
    { name: "3", shape: "poly", coords: [381,241,383,94,462,53,457,282], fillColor: "yellow"  },
    { name: "4", shape: "poly", coords: [245,285,290,285,274,239,249,238], preFillColor: "red"  },
    { name: "5", shape: "circle", coords: [170, 100, 25 ] },
  ]
};


const styles = {
    paperContainer: {
        width: "100vh",
        height: "100vh",
        backgroundImage: `url(${Image})`
    }
};

var sectionStyle = {
    height: `calc(100vh + 58px)`,
    display: "flex",
    backgroundImage: `url(${Image})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    width: `calc(100vw + 58px)`,
    margin: -38,
    padding: 48
};

function Cabinet() {
  var classes = useStyles();
  var theme = useTheme();



  return (
   <div className="container">
    <ImageMapper src={Image} map={MAP} width={500}
    />
</div>

  );
}

export default Cabinet;
